import project1 from '../assets/project1.png';
import project2 from '../assets/project2.png';
import project3 from '../assets/project3.png';

const PROJECTS = [
    {
        id: 1,
        title: 'React application portfolio',
        discription: 'Building first React application involving JS and core web dev concepts!!',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project1
    },
    {
        id: 2,
        title: 'My API',
        discription: 'Building REst API that I built from scratch with GET and POST methods.',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project2
    },
    {
        id: 3,
        title: 'Operating System Final Project',
        discription: 'Unique project in Operating System.',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project3
    }
];

export default PROJECTS;
